; Helper functions
vm_push:
    ; Push EAX onto VM stack
    mov     ebx, [stack_ptr]     ; get current stack pointer
    mov     [stack + ebx*4], eax ; store value
    inc     ebx                  ; increment stack pointer
    mov     [stack_ptr], ebx     ; save new stack pointer
    ret

vm_pop:
    ; Pop from VM stack into EAX
    mov     ebx, [stack_ptr]     ; get current stack pointer
    dec     ebx                  ; decrement stack pointer
    mov     [stack_ptr], ebx     ; save new stack pointer
    mov     eax, [stack + ebx*4] ; load value
    ret

putchar:
    ; Print character in EAX to stdout
    push    eax                  ; save character
    mov     eax, 4               ; sys_write
    mov     ebx, 1               ; stdout
    mov     ecx, esp             ; pointer to character on stack
    mov     edx, 1               ; length = 1
    int     0x80                 ; syscall
    pop     eax                  ; restore stack
    ret

